import React, { Component } from "react";
import AnalitikComponent from "../Components/AnalitikComponent";
import DataAnalitikComponent from "../Components/DataAnalitikComponent";
import { connect } from "react-redux";
import { getAnalitikList } from "../Action/BarangAction";
// import ApexCharts from 'apexcharts';


class AnalitikContainer extends Component {
    componentDidMount() {
        this.props.dispatch(getAnalitikList());
      }
      render() {
        return (
          <div>
            <AnalitikComponent />
            <DataAnalitikComponent />
          </div>
        );
      }
    }


export default connect()(AnalitikContainer);
